import React from 'react';
import { Slide } from "react-awesome-reveal";

//contact email, linkedIn, github

function Contact() {
    return(
        <section id="contact">
            <h2 className="page-title">Contact</h2>
            <section className="contact">
            <h3 Slide>By E-mail: <a href='mailto:alicia.keberle@gmail.com'> alicia.keberle@gmail.com</a></h3>
            <h3 Slide>LinkedIn: <a href="https://www.linkedin.com/in/keberlea/">linkedin.com/in/keberlea</a></h3>
            <h3 Slide>GitHub: <a href="https://github.com/keberlea">Github.com/keberlea</a></h3>
            </section>
        </section>
    )
}

export default Contact;
